import React from "react";
import { Container, Button} from "reactstrap";
import ParticlesComponent from 'components/Particles/Particles.js'

function IndexHeader() {
  return (
    <>
      <div
        className="page-header section-dark"
        style={{
          backgroundImage:
            "url(" + require("assets/img/bastion.jpg") + ")",
        }}
      >
        <ParticlesComponent />  
        <div className="content-center"  >
          <Container style={{display:"flex" }}>
            <div className="title-brand">
              <h1 className="presentation-title">Imminent</h1>
            </div>
            <h2 className="presentation-subtitle text-center"> 
            We are what we repeatedly do. Excellence,.
            <br/> then, is not an act, but a habit.
            </h2>
            <Button style={{display:"inline-block",zIndex:15,margin:"5rem 0 0 4rem"}} href="https://docs.google.com/forms/u/1/d/1tZQHYzSwy39Wpy9mbi66nchmWwi6pWrPSP_0lLjtMzw" target="_blank" className="btn btn-info btn-framed"> Apply Now</Button> 
            <Button style={{display:"inline-block",zIndex:15,margin:"5rem 0 0 2rem"}} href="https://www.wowprogress.com/guild/eu/twisting-nether/Imminent" target="_blank" className="btn btn-info btn-framed"> WoW Progress</Button> 
            <Button style={{display:"inline-block",zIndex:15,margin:"5rem 0 0 2rem"}} href="https://raider.io/guilds/eu/twisting-nether/Imminent" target="_blank" className="btn btn-info btn-framed"> Raider IO</Button> 
          </Container>

        </div>     

      </div>


    </>
  );
}

export default IndexHeader;
